import React from "react"

const PDFChecker = ({ name }) => {
  const extractedType = name.includes("_")
    ? name.split("_")[0]
    : "No underscore found"

  return (
    <div>
      <p>File: {name}</p>
      <p>Extracted Type: {extractedType}</p>
    </div>
  )
}

export default PDFChecker
